contracts/Swap.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Swap {
    AggregatorV3Interface internal ethUsdPriceFeed;
    AggregatorV3Interface internal usdcUsdPriceFeed;
    IERC20 public usdcToken;

    address public owner;

    constructor() {
        owner = msg.sender;

        
        usdcToken = IERC20(0xfFcEf71Ea3221b3eA2c4459aE1bA4989eBfF904a);

        
        ethUsdPriceFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);

        
        usdcUsdPriceFeed = AggregatorV3Interface(0x51597f405303C4377E36123cBc172b13269EA163);
    }

    
    receive() external payable {}

    
    function depositUSDC(uint256 amount) external {
        require(amount > 0, "Amount must be greater than 0");
        bool success = usdcToken.transferFrom(msg.sender, address(this), amount);
        require(success, "USDC transfer failed");
    }

    
    function swapEthToUsdc() external payable {
        require(msg.value > 0, "ETH not sent");

        uint256 ethUsd = _getLatestEthPrice();
        uint256 usdcUsd = _getLatestUsdcPrice();

        uint256 ethInUsd = (msg.value * ethUsd) / 1e8;
        uint256 usdcAmount = (ethInUsd * 1e6) / usdcUsd;

        require(usdcToken.balanceOf(address(this)) >= usdcAmount, "Insufficient USDC in contract");

        bool sent = usdcToken.transfer(msg.sender, usdcAmount);
        require(sent, "USDC transfer failed");
    }

    
    function swapUsdcToEth(uint256 amount) external {
        require(amount > 0, "Amount must be greater than 0");

        uint256 ethUsd = _getLatestEthPrice();
        uint256 usdcUsd = _getLatestUsdcPrice();

        uint256 usdcInUsd = (amount * usdcUsd) / 1e6;
        uint256 ethAmount = (usdcInUsd * 1e8) / ethUsd;

        require(address(this).balance >= ethAmount, "Insufficient ETH in contract");

        bool received = usdcToken.transferFrom(msg.sender, address(this), amount);
        require(received, "USDC transfer failed");

        payable(msg.sender).transfer(ethAmount);
    }

    
    function _getLatestEthPrice() internal pure returns (uint256) {
    return 3000 * 1e8;
    }

    function _getLatestUsdcPrice() internal pure returns (uint256) {
    return 1 * 1e8;
    }
}

